response.activities:
Здравствуйте, если Вы из г.Орска, вероятно, это Вас заинтересует. Предлагаем уход за могилами Ваших близких на кладбищах гг Орска и Новотроицка. В перечень услуг входит:
• текущий уход за могилой
• ежегодная посадка весенне-, летне- и осеннее-цветущих растений;
• оформление могилы срезкой, горшечными растениями, венками к общим религиозным праздникам или персональным дням памяти;
• частичное обновление посадок или подсаживание растений по мере необходимости;
• подстрижка травы;
• укладка плитки.
Стоимость годового обслуживания 3900 руб.
Вся дополнительная информация по тел. в Орске (3537) 333-225
